      <div className="modal-content">
        <div className="center">
          <h3>{winnerName}fwef</h3>
          <div className="w100-width"><div className="gif-inner-div"><iframe title="Gif-Confetti" height="100%" src="https://giphy.com/embed/YTbXXmG5SNfvn0K6s0/video" className="" width="100%"></iframe></div></div>
          <Buttons text="NEW GAME" />
        </div>
      </div>
    </div>
  )
}
